import React from 'react'

export default function ChatHeading({name, numbersOfUsers}) {
    return (
        <div>
            <div className="chat-header">
                <div className="user-info">
                    <div className="user-name">
                        {name}
                    </div>
                    <span>{numberOfUsers ? numberOfUsers : null}</span>
                </div>
            </div>
        </div>
    );
}
